description: "Hot Sugar x MiniNova Subscribe to NovationTV: http://bit.ly/NovationTV ~ Click 'show more' for additional information. Hot Sugar's production techniques are a little unconventional in that he uses found sounds as the sonic source for most of the elements in his tracks, a technique he calls 'associative music'. These sounds can vary from the static on an analogue TV â€” sculpted in various ways to create an number of different instruments â€” to samples from an impressive collection of musical toys and random noise-making devices that Nick keeps within arms reach when making music. It was because of this that we decided to ask Hot Sugar to dig into the MiniNova's sound-processing and synthesis capabilities to see what it can do. Get Hot Sugar's new EP here: http://hotsugar.bandcamp.com/album/midi-murder-ep Check out these other MiniNova videos: Dorian Concept x MiniNova: http://youtu.be/9dZWJFKyUSc MiniNova performance: http://youtu.be/uvDfHhuFF5w Artist first look: http://youtu.be/m7fJ7nUWPkU Vocoder and VocalTuneâ„¢: http://youtu.be/IAgANvgD4KE MiniNova is a compact, super-cool performance synth with the same sound engine as its big brother: the UltraNova. It comes with 256 incredible onboard sounds which you can tweak with 5 knobs, or totally warp with 8 'animate' buttons. MiniNova also has an onboard VocalTuneâ„¢ effect as well as a classic vocoder so you can recreate iconic vocal sounds from Hip Hop, Urban and electronic music. Novation MiniNova key features: â€¢ Hugely powerful micro synthesizer with UltraNova's sound engine â€¢ Brand new VocalTuneâ„¢ and classic vocoder effects â€¢ Live synth: tweak and warp your sounds in realtime â€¢ 256 awesome onboard sounds - instantly searchable â€¢ Layer up to 5 effects per voice â€¢ Comes with editing software and a software patch librarian â€¢ Run guitars and other instruments through the vocoder, VocalTuneâ„¢ and effects â€¢ 37 key controller keyboard with MIDI I/O For more videos subscribe to our YouTube channel here: http://bit.ly/NovationTV",
